export const Pdf = () => {
    return(
        <div className="Container">
            <h1>seso</h1>
            <iframe src="https://drive.google.com/file/d/1UaCdUdUJPO_NW2Qvj2iJUgRQkV2V5aTZ/view?usp=sharing" width={640}/>
        </div>
    )
}

export default Pdf;
